using Krafvaerk_shop.DBModels;
using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.DependencyInjection;
using System;
using System.Linq;

namespace Krafvaerk_shop.Data
{
    public static class SeedData
    {
        public static void Initialize(IServiceProvider serviceProvider)
        {
            using (var context = new Data.ShopDBContext(serviceProvider.GetRequiredService<DbContextOptions<Data.ShopDBContext>>()))
            {
                if (context.ProductCategorie.Any())
                {
                    return;   // DB has been seeded
                }

                //Add testing data
                
                context.ProductCategorie.AddRange(
                    new ProductCategory { Name = "Digital" },
                    new ProductCategory { Name = "Service" },
                    new ProductCategory { Name = "Standard" }
                );

                //for simplicity, lets add the image as base64 in the path param.
                context.Media.AddRange(
                    new Media { Name = "c-for-dummies1", ContentType = "image/jpeg", FileSize = 124, Path = "data:image/jpeg;base64," },
                    new Media { Name = "c-for-dummies2", ContentType = "image/jpeg", FileSize = 255, Path = "data:image/jpeg;base64," },
                    new Media { Name = "Tutoring", ContentType = "image/jpeg", FileSize = 234, Path = "data:image/jpeg;base64,"},
                    new Media { Name = "js-coockbook", ContentType = "image/jpeg", FileSize = 123, Path = "data:image/jpeg;base64," },
                    new Media { Name = "html-for-dummies", ContentType = "image/jpeg", FileSize = 145, Path = "data:image/jpeg;base64," },
                    new Media { Name = "css-for-dummies", ContentType = "image/jpeg", FileSize = 134, Path = "data:image/jpeg;base64," }
                );

                context.SaveChanges();


                context.Product.AddRange(
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Digital").Id, MediaId = context.Media.First(x => x.Name == "c-for-dummies1").Id, Name = "C# for dummies part 1", Price = 15.50M, Vat = 10.00M, Description = "Ultimate book for starting coders. Learn to code in just 2 weeks."},
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Digital").Id, MediaId = context.Media.First(x => x.Name == "c-for-dummies2").Id, Name = "C# for dummies part 2", Price = 15.50M, Vat = 10.00M, Description = "Ultimate sequal book for starting coders. Learn to code a little better in just 5 weeks." },
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Service").Id, MediaId = context.Media.First(x => x.Name == "Tutoring").Id, Name = "C# personal tutoring session", Price = 200, Vat = 24.00M, Description = "Our coding sensei will come to your shack and teaches you the art of programming."},
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Standard").Id, MediaId = context.Media.First(x => x.Name == "js-coockbook").Id, Name = "Javascript cookbook", Price = 30.50M, Vat = 24, Description = "Learn the basics of javascript by studying this printed copy"},
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Standard").Id, MediaId = context.Media.First(x => x.Name == "html-for-dummies").Id, Name = "HTML for dummies", Price = 5.50M, Vat = 24, Description = "HTML for dummies" },
                    new Product { Created = DateTime.Now, CategoryId = context.ProductCategorie.First(x => x.Name == "Standard").Id, MediaId = context.Media.First(x => x.Name == "css-for-dummies").Id, Name = "CSS for dummies", Price = 22.50M, Vat = 24, Description = "Learn to ramp up your webpages appearance in this printed book on Cascading Style Sheets" }
                );

                context.SaveChanges();

            }
        }
    }
}
